import ReactDOM  from "react-dom";
import React, {useState} from "react";
import Card from "./Card";
import contact from "./contact";
import Detail from "./Detail";


function createCard(contact){
    return (
    <Card 
        key = {contact.id}
        name = {contact.name}
        tel = {contact.tel}
        email = {contact.email}
    />);
}

function App(){
    return <div>
        {contact.map(createCard)}
    </div>

}
export default App;
